import {Box, Button, makeStyles, TextField} from "@material-ui/core"
import {OnlyOwner} from "../hooks/hookAdmin"


export const Admin = () => {

    const hook = OnlyOwner()

    const _getState = () => {
        //console.log(hook._getState())
        //const x = Number(hook._getState())
        const x = hook._getState()
        switch(x){
            case 0: {
                console.log("STATE: OPEN")
            }
            case 1: {
                console.log("STATE: CLOSED")
            }
            case 2: {
                console.log("STATE: CALCULATING_WINNER")
            }
        }
    }

    return (
        <>
            <Button variant="outlined" size="large" onClick={_getState}>GET STATE</Button>
            <Button variant="outlined" size="large" onClick={() => hook._getBalance()}>GET BALANCE</Button>
            <div>START LOTTERY</div>
            <div>ENTER LOTTERY</div>
            <div>END LOTTERY</div>
        </>
    )
}
